import styled from "styled-components"
import Logo from "./logo"

const HeaderInicioStyled = styled.header`
    display: flex;
    padding: 20px 20px;
`

function Header () {
    return (
        <header className="header">
            <Logo />
        </header>
    )
}

export default Header
